name: Autograding Tests
'on': push
permissions:
  checks: write
  actions: read
  contents: read
jobs:
  run-autograding-tests:
    runs-on: ubuntu-latest
    if: github.actor != 'github-classroom[bot]'
    steps:
      - name: Checkout code
        uses: actions/checkout@v4
      - name: Count
        id: count
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Count
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestCount
          timeout: 3
          max-score: 2.75
      - name: Most Frequent Item
        id: most-frequent-item
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Most Frequent Item
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestMostFrequentItem
          timeout: 3
          max-score: 2.75
      - name: Most Frequent Count
        id: most-frequent-count
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Most Frequent Count
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestMostFrequentCount
          timeout: 3
          max-score: 2.75
      - name: Find Repeat Number
        id: find-repeat-number
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Find Repeat Number
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestFindRepeatNumber
          timeout: 3
          max-score: 2.75
      - name: Unique Array
        id: unique-array
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Unique Array
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestUniqueArray
          timeout: 3
          max-score: 2.75
      - name: Only Unique Items
        id: only-unique-items
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Only Unique Items
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestOnlyUniqueItems
          timeout: 3
          max-score: 2.75
      - name: Are All Items Unique
        id: are-all-items-unique
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Are All Items Unique
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestAreAllItemsUnique
          timeout: 3
          max-score: 2.75
      - name: List Cycle
        id: list-cycle
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: List Cycle
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestListCycle
          timeout: 3
          max-score: 26
      - name: Three Sum
        id: three-sum
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Three Sum
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestThreeSum
          timeout: 3
          max-score: 26
      - name: Is Anagram
        id: is-anagram
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Is Anagram
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestIsAnagram
          timeout: 3
          max-score: 10
      - name: Exclude Product
        id: exclude-product
        uses: classroom-resources/autograding-command-grader@v1
        with:
          test-name: Exclude Product
          setup-command: >
            echo "" | base64 -d | gzip -d > test_real.py
          command: python -m unittest test_real.TestExcludeProduct
          timeout: 3
          max-score: 26
      - name: Autograding Reporter
        uses: classroom-resources/autograding-grading-reporter@v1
        env:
          COUNT_RESULTS: "${{steps.count.outputs.result}}"
          MOST-FREQUENT-ITEM_RESULTS: "${{steps.most-frequent-item.outputs.result}}"
          MOST-FREQUENT-COUNT_RESULTS: "${{steps.most-frequent-count.outputs.result}}"
          FIND-REPEAT-NUMBER_RESULTS: "${{steps.find-repeat-number.outputs.result}}"
          UNIQUE-ARRAY_RESULTS: "${{steps.unique-array.outputs.result}}"
          ONLY-UNIQUE-ITEMS_RESULTS: "${{steps.only-unique-items.outputs.result}}"
          ARE-ALL-ITEMS-UNIQUE_RESULTS: "${{steps.are-all-items-unique.outputs.result}}"
          LIST-CYCLE_RESULTS: "${{steps.list-cycle.outputs.result}}"
          THREE-SUM_RESULTS: "${{steps.three-sum.outputs.result}}"
          IS-ANAGRAM_RESULTS: "${{steps.is-anagram.outputs.result}}"
          EXCLUDE-PRODUCT_RESULTS: "${{steps.exclude-product.outputs.result}}"
        with:
          runners: count,most-frequent-item,most-frequent-count,find-repeat-number,unique-array,only-unique-items,are-all-items-unique,list-cycle,three-sum,is-anagram,exclude-product
